import { useEffect, useState } from 'react';
import axios from 'axios';
import { FormControl, InputLabel, Select, MenuItem } from '@mui/material';

export default function VehicleStep({ setValue, vehicleTypeId }) {
  const [vehicles, setVehicles] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchVehicles = async () => {
      if (!vehicleTypeId) return;

      try {
        const response = await axios.get(
          `http://localhost:5000/api/vehicle-types/${vehicleTypeId}/vehicles`
        );
        setVehicles(response.data.vehicles || []);
      } catch (error) {
        console.error('Error fetching vehicles:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchVehicles();
  }, [vehicleTypeId]);

  if (loading && vehicleTypeId) return <div>Loading models...</div>;
  if (!vehicleTypeId) return <div>Please select a vehicle type first</div>;

  return (
    <FormControl fullWidth sx={{ mt: 3 }}>
      <InputLabel>Vehicle Model</InputLabel>
      <Select
        label="Vehicle Model"
        onChange={(e) => setValue('vehicle', e.target.value)}
      >
        {vehicles.map(vehicle => (
          <MenuItem key={vehicle.id} value={vehicle.id}>
            {vehicle.name}
          </MenuItem>
        ))}
      </Select>
    </FormControl>
  );
}
